query ($board_id: ID!, $cursor: String) {
 boards(ids:[$board_id]) {
 items_page(limit: 100, cursor: $cursor) {
 cursor
 items {
 id
 name
 group { id }
 column_values(types: [board_relation,date,item_id,name,numbers,people,phone,status,text]) {
 id
 type
 text
 ... on PeopleValue {
 persons_and_teams { id }
 }
 ... on DateValue {
 time
 date
 }
 ... on BoardRelationValue {
 linked_item_ids
 }
 }
 }
 }
 }
 }

